def evaluate_rpn(expression: str) -> float:
    """"""
    stack = []
    tokens = expression.split()
    for token in tokens:
        if token in ['+', '-', '*', '/']:
            b = stack.pop()
            a = stack.pop()
            c = str(eval(a + token + b))
            stack.append(c)
        else:
            stack.append(token)
    return float(stack[0])
